.rule-dialog {
  >>> .el-dialog__body {
    overflow: hidden;
    height: 320px;
    overflow: auto;
    overflow-x: hidden;
    padding: 23px 14px 2px !important;
  }
  .del-icon {
    line-height: 32px;

    cursor: pointer;
    color: #ff3a3a;
    >>> .icon-ym {
      font-size: 24px !important;
    }
  }
  .text-center {
    text-align: center;
  }
  .leading-32px {
    line-height: 32px;
  }
  .mt-10px {
    margin-top: 10px;
  }
  .mb-10px {
    margin-bottom: 10px;
  }
  .link-text {
    color: #1890ff;
    cursor: pointer;
    // margin-top: 10px;
    //  display: flex;
    .add-text {
      font-size: 14px;
      margin-right: 4px;
    }
  }
  .form-item-label {
    font-weight: 600;
    font-size: 14px;
    line-height: 32px;
  }
  .condition-pane {
    height: 100%;
    overflow: auto;
    overflow-x: hidden;
    font-size: 14px;
  }
  .ml-180px {
    margin-left: 180px;
  }
  .font-size {
    font-size: 14px;
  }
}
